import React from 'react'
import Button from 'react-bootstrap/Button';

import { Link } from 'react-router-dom'

export default function Home() {
  return (
    <section>
        <h2>Home Page</h2>
        <Link className='btn' to='/about'><Button variant="primary">About</Button>{' '}</Link>

    </section>
  )
}
